import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './Headers.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';

import logo from './img/zando-logo-small.png';

const Header = ({ wishlist, cart, user, setUser }) => {
    const [categories, setCategories] = useState([]);
    const [isNavbarOpen, setIsNavbarOpen] = useState(false);

    useEffect(() => {
        fetch('https://fakestoreapi.com/products/categories')
            .then((res) => res.json())
            .then((json) => setCategories(json))
            .catch((error) => console.error('Error fetching categories:', error));
    }, []);

    const handleLogout = () => {
        setUser(null);
    };

    const toggleNavbar = () => {
        setIsNavbarOpen(!isNavbarOpen);
    };

    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light sticky-top">
            <div className="container-md p-3">
                <Link className="navbar-brand" to="/">
                    <img src={logo} alt="logo" className="navbar-logo" />
                </Link>

                <button
                    className="navbar-toggler"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target="#navbarNav"
                    aria-controls="navbarNav"
                    aria-expanded={isNavbarOpen}
                    aria-label="Toggle navigation"
                    onClick={toggleNavbar}
                >
                    <span className="">
                        {isNavbarOpen ? (
                            <i className="fas fa-times"></i> // Icon for close
                        ) : (
                            <i className="fas fa-bars"></i>  // Icon for open
                        )}
                    </span>
                </button>

                <div className={`collapse navbar-collapse ${isNavbarOpen ? 'show' : ''}`} id="navbarNav">
                    <ul className="navbar-nav ms-auto">
                        {/* Shop dropdown */}
                        <li className="nav-item dropdown">
                            <span
                                className="nav-link dropdown-toggle"
                                id="shopDropdown"
                                role="button"
                                data-bs-toggle="dropdown"
                                aria-expanded="false"
                            >
                                Shop
                            </span>
                            <ul className="dropdown-menu" aria-labelledby="shopDropdown">
                                {categories.map((category) => (
                                    <li key={category}>
                                        <Link
                                            className="dropdown-item"
                                            to={`/shop/${category}`}
                                        >
                                            {category.charAt(0).toUpperCase() + category.slice(1)}
                                        </Link>
                                    </li>
                                ))}
                            </ul>
                        </li>

                        {/* Wishlist */}
                        <li className="nav-item">
                            <Link className="nav-link" to="/wishlist">
                                <i className="fas fa-heart"></i>
                                {wishlist.length > 0 && (
                                    <span className="badge bg-danger ms-1">{wishlist.length}</span>
                                )}
                            </Link>
                        </li>

                        {/* Cart */}
                        <li className="nav-item">
                            <Link className="nav-link" to="/cart">
                                <i className="fas fa-shopping-cart"></i>
                                {cart.length > 0 && (
                                    <span className="badge bg-danger ms-1">{cart.length}</span>
                                )}
                            </Link>
                        </li>

                        {/* User login/logout */}
                        {user ? (
                            <li className="nav-item">
                                <span className="nav-link">Welcome, {user.username}</span>
                                <button onClick={handleLogout} className="btn btn-link nav-link">
                                    Logout
                                </button>
                            </li>
                        ) : (
                            <li className="nav-item">
                                <Link className="nav-link" to="/login">
                                    <i className="fas fa-user"></i> Login
                                </Link>
                            </li>
                        )}
                        <li className="nav-item">
                            <Link className="btn btn-outline-primary ms-2" to="/register">
                                Register
                            </Link>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    );
};

export default Header;
